import React from 'react'
import {list, ListItem, ListItemAvatar, Avatar, ListItemText, Button} from '@material-ui/core';
// import './Todo.css';
import db from './firebase';
import DeleteIcon from '@material-ui/icons/Delete';

function Todo(props) {
    return (
        <list>
            <ListItem> 
                <ListItemAvatar>
                </ListItemAvatar>
                    <ListItemText primary={props.todo.todo} secondary="Dummy deadline">
                    </ListItemText>
                    <DeleteIcon variant="contained" color="secondary" onClick={event => db.collection('todos').doc(props.todo.id).delete()}>DELETE</DeleteIcon>
            </ListItem>
        </list>
    )
}

export default Todo
